Night Fisher (2005) (c2c) (getfreedregs) [By R. Kikuo Johnson]

R. Kikuo Johnson has created an intimate and compelling graphic novel-length drama of young men on the cusp of adulthood. First-rate prep school, S.U.V., and a dream house in the heights: This was the island paradise handed to Loren Foster when he moved to Hawaii with his father six years ago. Now, with the end of high school just around the corner, his best friend, Shane, has grown distant. The rumors say it's hard drugs, and Loren suspects that Shane has left him behind for a new group of friends.


